@francaru,
How have you registered the classifier?

Do you mind sharing the snippets of you code?

Sure thing.

```python
from onnxmltools.convert.xgboost.shape_calculators.Classifier import calculate_xgboost_classifier_output_shapes as xgboost_clf_shapes
from onnxmltools.convert.xgboost.operator_converters.XGBoost import convert_xgboost as xgboost_convert
from onnxmltools.utils import save_model as save

class XGBoostClassifierConverter(Converter):
    def to_args(self):
        cls = self.__class__
        return cls._get_type(), cls._get_identifier(), cls._calculate_output_shapes, cls._convert

    @staticmethod
    def _get_type():
        return XGBClassifier

    @staticmethod
    def _get_identifier():
        return XGBClassifier.__name__

    @staticmethod
    def _calculate_output_shapes(operator):
        xgboost_clf_shapes(operator)

    @staticmethod
    def _convert(scope, operator, container):
        xgboost_convert(scope, operator, container)

def register_custom_converters():		
    for converter in [XGBoostClassifierConverter(), ..]:
        update_registered_converter(*converter.to_args())

def save_model(pipeline, initial_types, name):
    # Update registered converters in sklearn
    register_custom_converters()

    # An ONNX model is achieved by converting the Sklearn Pipeline via the ONNX converters
    onnx_model = convert_sklearn(pipeline, name=name, initial_types=initial_types)

    # The model is saved
    save(onnx_model, '%s.onnx' % name)
```

As you can see, the above class has some methods which do pretty much the same thing as you described where I am registering a converter for XGBoost (note that it is in the form of a class as I am applying polymorphism across multiple converters in **'register_custom_converters'**).

Once converted, the save_model method passes the pipeline to the convert_sklearn function, and there is where the exception described in this thread is being raised.
